<script>

var margin = {top: 20, right: 20, bottom: 30, left: 50},
    width = 960 - margin.left - margin.right,
    height = 500 - margin.top - margin.bottom - 8;

var x = d3.scale.linear()
    .range([0, width]);

var y = d3.scale.linear()
    .range([height, 0]);

var xAxis = d3.svg.axis()
    .scale(x)
    .orient("bottom");

var yAxis = d3.svg.axis()
    .scale(y)
    .tickFormat(function (d) {return d + "%";})
    .orient("left");

var line = d3.svg.area()
    .interpolate("basis")
    .x(function(d) { return x(d["age"]); })
    .y(function(d) { return y(d["rent"]); });

var area = d3.svg.area()
    .interpolate("basis")
    .x(function(d) { return x(d["age"]); })
    .y1(function(d) { return y(d["rent"]); });

var svg = d3.select("body").append("svg")
    .attr("width", width + margin.left + margin.right)
    .attr("height", height + margin.top + margin.bottom)
  .append("g")
    .attr("transform", "translate(" + margin.left + "," + margin.top + ")");

d3.tsv("age.tsv", function(error, data) {
  data.forEach(function(d) { });

  x.domain(d3.extent(data, function(d) { return d["age"]; }));

  y.domain([
    d3.min(data, function(d) { return Math.min(d["rent"], d["own"]); }),
    d3.max(data, function(d) { return Math.max(d["rent"], d["own"]); })
  ]);

  svg.datum(data);

  svg.append("clipPath")
      .attr("id", "clip-below")
    .append("path")
      .attr("d", area.y0(height));

  svg.append("clipPath")
      .attr("id", "clip-above")
    .append("path")
      .attr("d", area.y0(0));

  svg.append("path")
      .attr("class", "area above")
      .attr("clip-path", "url(#clip-above)")
      .attr("d", area.y0(function(d) { return y(d["own"]); }));

  svg.append("path")
      .attr("class", "area below")
      .attr("clip-path", "url(#clip-below)")
      .attr("d", area);

  svg.append("path")
      .attr("class", "line")
      .attr("d", line);

  svg.append("g")
      .attr("class", "x axis")
      .attr("transform", "translate(0," + height + ")")
      .call(xAxis)
   .append("text")
      .attr("x", width)
      .attr("dy", "-.5em")
      .style("text-anchor", "end")
      .text("Age");
  
  svg.append("g")
      .attr("class", "y axis")
      .call(yAxis)
    .append("text")
      .attr("transform", "rotate(-90)")
      .attr("y", 6)
      .attr("dy", ".71em")
      .style("text-anchor", "end")
      .text("Percentage of Population (Normalized)");
      
  svg.append("text")

  	  .attr("x", width/2)
  	  .attr("text-anchor","middle")
  	  .style("fill", "black")
  	  .style("font-size", "32")
      .text("Age of Home Renters vs. Owners");
      
});
